import './App.css';

function App() {
  return (
    <div className="App">
      <h1>CRUD App</h1>
      <div className='form'>
        <label>Jugador: </label>
        <input type='text' name='jugador' />
        <label>Dorsal: </label>
        <input type='text' name='dorsal' />
        <label>Posicion: </label>
        <input type='text' name='posicion' />
        <button>Submit</button>
      </div>
    </div>
  );
}

export default App;
